/** @format */
import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <div className="container Navbar">
        <div className="row ">
          <div className="col-md-6 logoo">
            <h1>
              Usman<span style={{ color: "yellowGreen" }}>Khalid</span>{" "}
            </h1>
          </div>
          <div className="col-md-6 Navlinks  ">
            <ul className="d-flex justify-content-end ">
              <li>
                <NavLink href="facebook.com">Home</NavLink>
              </li>
              <li>
                <NavLink href="facebook.com">Services</NavLink>
              </li>
              <li>
                <NavLink href="facebook.com">About</NavLink>
              </li>
              <li>
                <NavLink href="facebook.com">Contact</NavLink>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};
export default Navbar;
